from (
    select p.hospitalid, sum(c.cost) as total_cost
    from medication m
    join patient p on m.patientunitstayid = p.patientunitstayid
    join cost c on c.eventtype = 'medication' and c.eventid = m.medicationid
    where lower(m.drugname) = 'dextrose 50% adult'
    group by p.hospitalid
) hospital_costs;

