from (
    select p.uniquepid, sum(c.cost) as total_cost
    from patient p
    join diagnosis d on p.patientunitstayid = d.patientunitstayid
    join cost c on p.uniquepid = c.uniquepid
    where lower(d.diagnosisname) like '%neurogenic shock%'
    and extract(year from d.diagnosistime) = 2102
    group by p.uniquepid
) as patient_costs;

select avg(total_cost) as average_total_cost
from (
    select p.uniquepid, p.patienthealthsystemstayid, sum(c.cost) as total_cost
    from patient p
    join diagnosis d on p.patientunitstayid = d.patientunitstayid
    join cost c on p.uniquepid = c.uniquepid and p.patienthealthsystemstayid = c.patienthealthsystemstayid
    where lower(d.diagnosisname) = 'hypertension - controlled'
    group by p.uniquepid, p.patienthealthsystemstayid
) as patient_costs;

